INSERT INTO `disposalprocedures` VALUES (217,'1','Sulfur Mustards','','Oxidation','Activated Peroxidation: HD + 0.1 M NaHCO3 + 50 wt% H2O2 (ethanol solvent) – t1/2 = 1.8 min. Essentially only very low-toxicity sulfoxides formed [3]. <br>HD + 50 vol% H2O2 (3 wt%) + NaHCO3 (5 wt%) + 50 vol% i-PrOH (70%) [4]. <br>H2O2:  HD + H2O2 – t1/2 = 133 min. Essentially only sulfoxides formed [5]. UV light + 10-4 M H2O2 – t1/2 = ~3 min [6].<br>Bleach: HD + NaOCl (~5 wt%, household, full strength) – t1/2 = 8 min vinyl-2-chloroethyl sulfone and \"slight\" mustard sulfone and toxic divinyl sulfone products [5].','The main product includes mustard sulfoxide (Bis2-chloroethyl) sulfoxide) with some additional oxidation to produce mustard sulfone (Bis(2-chloroethyl) sulfone).','Waste collection and disposal as hazardous waste or diluted for sanitary sewer disposal with a (large excess of water [7].'),(218,'1','Nitrogen Mustards','','Hydrolysis','Hydrolysis: HN(1, 2, 3) + water + slightly basic conditions, rate increases with temperature and pH [7]','HN1 products—very low toxicity, mostly mild irritants. Some specific products include: Ethyldiethanolamine and diethanolamine.<br>HN2 products—more toxic than HN1 products. Some specific products include: N-methyl-2-hydroxy-2-chloro diethyl ammonium chloride, 2-(2-chloroethyl)methylamino ethanol hydrochloride, N,N’-dimethyl-N,N’bis(2-chloroethyl) piperazinium, <br>N-methyldiethanolamine.<br>HN3 products—low toxicity. Some specific products include:<br>Bis(2-chloroethyl)-2-hydroxyethyl ammonium chloride, 2-chloroethyl-bis(2-hydroxyethyl) ammonium chloride, triethanolamine chloride.','Products from HN1 and HN3 may be disposed as hazardous waste or diluted for sanitary sewer disposal with a (large excess of water). Products from HN2 should be disposed by hazardous waste collection and processed through an approved hazardous waste disposal facility'),(219,'1','Lewisites','','Oxidation','Oxidation: L(1, 2, 3) + NaOCl (5 wt%) OR H2O2 (3 wt%)—not detected after 30 min [8].','2-chlorovinylarsonic acid (C2H4AsClO3) is the main product. Additional products may include 2-chlorvinyl arsenous acid if hydrolysis occurs or if 2-chlorovinyl arsenous acid isn’t fully oxidized to 2-chlorovinlyarsonic acid.','2-chlorovinylarsonic acid can be converted to sodium arsenate salts, then to ferric arsenic salts for disposal in a licensed hazardous waste facility [9].'),(220,'1','Nerve Agents','','Oxidation','Activated Peroxidation:<br>GB + 0.037 M NaHCO3 + 30%<br>H2O2 + t-BuOH (cosolvent) – t½ < 1 min [3].<br>GD + 50 vol% H2O2 (3 wt%) – ND (not detectable) after 4 min [4].<br>VX + 50 vol% H2O2 (3 wt%) + 1 wt% Na2CO3 – ND after 4 min [4]. More reactions for VX are also listed in Table 1 [3]. Sodium perborate can be used as an alternative to H2O2.<br>:<br>GB + 0.037 M NaHCO3 + 30%<br>H2O2 + t-BuOH (cosolvent) – t½ < 1 min [3].<br>GD + 50 vol% H2O2 (3 wt%) – ND (not detectable) after 4 min [4].<br>VX + 50 vol% H2O2 (3 wt%) + 1 wt% Na2CO3 – ND after 4 min [4]. More reactions for VX are also listed in Table 1 [3]. Sodium perborate can be used as an alternative to H2O2.<br>Hydrogen peroxide and bleach: Very similar to reactions listed above for activated peroxidation, but much the reaction times are slower. Additionally, oxidation of VX cannot occur without basic conditions [9] and the presence of water [10] unless molybdate is present [3]. VX is not very miscible in water, forming a separate organic phase. Light mixing is necessary for rapid reactions.','IMPA, MPA (main), and possibly HF<br>Pinacolyl methylphosphonic acid or MPA (main) and possibly HFEMPA, MPA, and ethyl diisopropylamino compound [9]','Alkyl methylphosphonic acids can be oxidized to H3PO4, CO2, and H2O using excess H2O2, O2, and UV light [12]. <br>If any organic products form (possibly i-PrOH, and alkanes), they will likely separate from the acidic aqueous solution. Acidic solution can be neutralized, and organic waste can be combined with like organic wastes for hazardous waste disposal (see section 3.1.2 for HF waste).'),(221,'1','Nerve Agents','','Oxidation','Hydrogen peroxide and bleach: Very similar to reactions listed above for activated peroxidation, but much the reaction times are slower. Additionally, oxidation of VX cannot occur without basic conditions [9] and the presence of water [10] unless molybdate is present [3]. VX is not very miscible in water, forming a separate organic phase. Light mixing is necessary for rapid reactions.','IMPA, MPA (main), and possibly HF<br>Pinacolyl methylphosphonic acid or MPA (main) and possibly HFEMPA, MPA, and ethyl diisopropylamino compound [9]','Alkyl methylphosphonic acids can be oxidized to H3PO4, CO2, and H2O using excess H2O2, O2, and UV light [12]. <br>If any organic products form (possibly i-PrOH, and alkanes), they will likely separate from the acidic aqueous solution. Acidic solution can be neutralized, and organic waste can be combined with like organic wastes for hazardous waste disposal (see section 3.1.2 for HF waste).'),(222,'1','Nerve Agents','','Hydrolysis','GA/GB/GD + H2O + pH~10-11 (NaOH)','GA—end product is phosphoric acid (H3PO4) [9]. Acidic conditions produce dimethylamine as an intermediate byproduct. Basic conditions produce the CN anion as an intermediate byproduct [9].<br>GB/GD—reduced to respective, non-toxic monophosphonic acids IMPA (GB), Pinacolyl MPA (GD), and HF within a few minutes [7] [10]. Acetate ions were also found to significantly accelerate hydrolysis of GB and GD [11].','Alkyl methylphosphonic acids can be oxidized to H3PO4, CO2, and H2O using excess H2O2, O2, and UV light [12]. <br>If any organic products form (possibly i-PrOH, and alkanes), they will likely separate from the acidic aqueous solution. Acidic solution can be neutralized, and organic waste can be combined with like organic wastes for hazardous waste disposal (see section 3.1.2 for HF waste).'),(223,'1 B','Precursors','','Oxidation/Hydrolysis','Chlorosarin, Chlorosoman, and DF all have very similar structures to GB/GD and are expected to respond similarly to the reactions listed in the tables above.<br>QL has a structure similar to VX (used as a simulant), and it is expected the ester and amino groups will be susceptible to oxidation [12] [13].','R-MPAs, HCl (for chloro-GB/GD), HF (for DF)EMPA is the main product. Trialkyl amines and dialkyl amines are possible products.','UV and advanced oxidation treatment (UV-H2O2) can be performed for the generated wastes followed by disposal in sanitary sewer with a large excess of water. <br>(See HF recommendations in section 3.1.2. below).'),(224,'1 B','Ricin','','Oxidation','Bleach: Deactivated after 15 min treatment with NaOCl (household concentrations) [14]. Lowest concentration for deactivation of cytotoxicity is 3 mM NaOCl [15].','Denatured ricin protein','Neutralization of caustic solution followed by disposal in sanitary sewer with a large excess of water.'),(225,'1 B','Saxitoxin','','Oxidation','Bleach: Deactivated after 30 min treatment with >0.1% NaOCI or 0.25% NaOCI + 0.25N NaOH [14].','Denatured saxitoxin protein','Neutralization of caustic solution followed by disposal in sanitary sewer with a large excess of water.'),(226,'2A','Toxic Chemicals','','Oxidation','Activated peroxidation [16] [17]','Alkyl methyl phosphonic acids','Alkyl methyl phosphonic acids can be oxidized to H3PO4, CO2, and H2O using excess H2O2, O2, and UV light [12].'),(227,'2A','Toxic Chemicals','','Hydrolysis','Decomposes rapidly in water, forming multiple Intermediates including fluorophosgene','Ultimately decomposes to the CO2 radical anion and HF [18]','If fluorine is not a concern, HF can be neutralized with NaOH soln. If fluorine is a concern, then CaCO3 can be used to form CaF–2, a non-toxic precipitate that is disposed of as solid waste [19].'),(228,'2A','Toxic Chemicals','','Hydrolysis','BZ + water + acidic conditions (pH~13) – t1/2 = 1.8 min. Rate of hydrolysis decreases as pH decreases and/or temperature increases [20].','3-quinuclidinol and benzilic acid','Neutralization and sanitary sewer disposal with a large excess of water. See additional treatment option for benzylic acid in <br>Section 3.2.'),(229,'2B','Precursors','Methylphosphonyl dichloride','Hydrolysis/<br>Oxidation','Reacts violently with water. Further oxidation is likely.','HCl and methylphosphite, further oxidation to create phosphate/phosphoric acid','Alkyl methyl phosphonic acids can be oxidized to H3PO4, CO2, and H2O using excess H2O2, O2, and UV light [12].'),(230,'2B','Precursors','Dimethyl methylphosphonate (DMMP)','Oxidation','Oxidized by OH radicals [17]','Phosphate/phosphoric acid','Neutralization and sanitary sewer disposal with a large excess of water'),(231,'2B','Precursors','Dimethyl ethylphosphonate (DMEP)','Oxidation','Oxidized by OH radicals [14]','Phosphate/phosphoric acid','Neutralization and sanitary sewer disposal with a large excess of water'),(232,'2B','Precursors','Methylphosphinyl difluoride','Hydrolysis','Reacts with water [15]','HF and methyl phosphonic acid [15]','Neutralization and sanitary sewer disposal with a large excess of water <br>(See also methyl phosphonic acid below)'),(233,'2B','Precursors','Methylphosphonic acid<br>Methylphosphinyl dichloride<br>Methylphosphonyl dichloride<br>Methylphosphonothioic dichloride','Hydrolysis/<br>Oxidation','Oxidized under supercritical conditions [21] [20]','Mineralized products [20]','Disposal after precipitation of calcium salts and evaporation of the water for recycle and burn [20]'),(234,'2B','Precursors','Methylphosphonic acid<br>Methylphosphinyl dichloride<br>Methylphosphonyl dichloride<br>Methylphosphonothioic dichloride','Hydrolysis/<br>Oxidation','Alkyl methyl phosphonic acids can be oxidized to H3PO4, CO2, and H2O using excess H2O2, O2, and UV light [12].','H3PO4, CO2, and H2O [12].','Neutralization and sanitary sewer disposal with a large excess of water'),(235,'2B','Precursors','Methylphosphonic acid<br>Methylphosphinyl dichloride<br>Methylphosphonyl dichloride<br>Methylphosphonothioic dichloride','Hydrolysis/<br>Oxidation','Reacts violently with water. Further oxidation is likely [22].','HCl and methylphosphite, further oxidation to create phosphate/phosphoric acid','Neutralization and sanitary sewer disposal with a large excess of water'),(236,'2B','Precursors','Methylphosphonyl difluoride','Hydrolysis/<br>Oxidation','Reacts with water and expected to react with oxidizing agents [23].','HF and methyl phosphonic acid [23]','Neutralization and sanitary sewer disposal with a large excess of water <br>(See also methyl phosphonic acid above'),(237,'2B','Precursors','Ethylphosphinyl dichloride<br>Ethylphosphonyl dichloride','Hydrolysis/<br>Oxidation','Reacts violently with water. Further oxidation is likely.','HCl and ethylphosphite, further oxidation to create phosphate/phosphoric acid','Neutralization and sanitary sewer disposal with a large excess of water'),(238,'2B','Precursors','Ethylphosphinyl dichloride<br>Ethylphosphonyl dichloride','Hydrolysis/<br>Oxidation','Acid chlorides react rapidly with potassium hydroxide [24]','Mineralized products','Disposal of salts after evaporation of the water for recycle.'),(239,'2B','Precursors','Diethyl methylphosphonite','Hydrolysis/<br>Oxidation','Reacts with water [23] [25]','ethyl hydrogen methylphosphinate for 1:1 mole ration and dihydrogen methylphosphinate and ethanol for 2:1 mole ratio [25]','See alkyl methyl phosphonate above)'),(240,'2B','Precursors','Diethyl methylphosphonite','Hydrolysis/<br>Oxidation','Expected to react with oxidizing agents [23]','','See alkyl methyl phosphonate above)'),(241,'2B','Precursors','Diethyl methylphosphonate (DEMP)<br>Diethyl ethylphosphonate (DEEP)','Oxidation','Oxidized by OH radicals [14]','Phosphate/phosphoric acid','Neutralization and sanitary sewer disposal with a large excess of water'),(242,'2B','Precursors','Arsenous Trichloride','Hydrolysis','Reacts violently with water to form As(OH)3 and HCl [25].','As(OH)3 and HCl','Dissolve in acidified boiling water (1g As/100mL H2O with 6 drops conc. HCl). Add 0.2 g thioacetamide in 20 mL H2O per 1 g As. Boil for 20 min. and basify with 2M NaOH (8g NaOH(s) in 100mL H2O). As2S3 precipitates and can be dried and packaged for disposal [26].'),(243,'2B','Precursors','Benzilic Acid: 2,2-Diphenyl-2-hydroxyacetic acid','Acid-Based Neutralization or Electrophilic Substitution','Addition of a base to form ionic salt (i.e. NaHCO3 or NH3) or substitution of the hydrogen on the hydroxyl group with NaOH and an electrophile (i.e., RCOOH + NaOH + CH3I --> RCOOCH3 + H2O + NaI, CH3+ would be the electrophile) [21]','RCOOH + NaOH + CH3I --> RCOOCH3 + H2O + NaI, CH3+','Neutralization and sanitary sewer disposal with a large excess of water.'),(244,'2B','Precursors','Quinuclidin-3-ol','Dehydration','Dehydration of alcohol (excess H2SO4 & heat) [14]','','UV and advanced oxidation treatment (UV-H2O2), then disposed in sanitary sewer with a large excess of water. Quinuclidin-3-ol can be treated directly by modern sewage plant if dilute enough.'),(245,'2B','Precursors','Quinuclidin-3-ol','Oxidation','Oxidation of alcohol to ketone (K2Cr2O7 + acidic conditions) [14]','','UV and advanced oxidation treatment (UV-H2O2), then disposed in sanitary sewer with a large excess of water. Quinuclidin-3-ol can be treated directly by modern sewage plant if dilute enough.'),(246,'2B','Precursors','N,N-Dialkyl (Me, Et, n-Pr or i-Pr) aminoethyl-2-chlorides and corresponding protonated salts','Oxidation','Reacts with strong acids, strong bases, strong oxidizing agents [27]','Hydrogen chloride, nitrogen oxides, carbon monoxide, carbon dioxide','Neutralization and sanitary sewer disposal with a large excess of water'),(247,'2B','Precursors','N,N-Dialkyl (Me, Et, n-Pr or i-Pr) aminoethane-2-ols and corresponding protonated salts','Acid-Based Neutralization','Neutralizes acids in exothermic reactions to form salts plus water [19]','','Disposal of salts after evaporation of the water for recycle.'),(248,'2B','Precursors','N,N-Dimethylaminophos-phoryl dichloride','Hydrolysis','Reacts with water [28]','Hydrochloride acid [28]',''),(249,'2B','Precursors','Thiodiglycol (Bis(2-hydroxyethyl)sulfide)','Oxidation','Decontamination product of sulfur mustard (see sulfur mustard in section 2.1).','Oxidation to produce mustard sulfone (Bis(2-chloroethyl) sulfone) [5] [6].','Sanitary sewer disposal with a large excess of water [7].'),(250,'2B','Precursors','Thiodiglycol (Bis(2-hydroxyethyl)sulfide)','Biodegradation','Biodegradation reactor containing ordinary sewage sludge [7]','Carbon dioxide, water, and sulfate [7]','Sanitary sewer disposal with a large excess of water [7].'),(251,'2B','Precursors','Pinacolyl alcohol: 3,3-Dimethylbutan-2-ol','Dehydration','Dehydration of alcohol (excess H2SO4 & heat) [14]','','UV and advanced oxidation treatment (UV-H2O2), then disposed in sanitary sewer with a large excess of water. Pinacolyl alcohol can be treated directly by modern sewage plant if dilute enough.'),(252,'2B','Precursors','Pinacolyl alcohol: 3,3-Dimethylbutan-2-ol','Oxidation','Oxidation of alcohol to ketone (K2Cr2O7 + acidic conditions) [14]','','UV and advanced oxidation treatment (UV-H2O2), then disposed in sanitary sewer with a large excess of water. Pinacolyl alcohol can be treated directly by modern sewage plant if dilute enough.'),(253,'3A','Toxic Chemicals','Phosgene: Carbonyl dichloride (75-44-5)','Oxidation','Bubble phosgene gas through 10-20% NaOH concentration [26] [29].','Chloride salt and some CO2','Chloride salt solution can then be neutralized and disposed in sanitary sewer with a large excess of water'),(254,'3A','Toxic Chemicals','Cyanogen chloride','Oxidation','CN-compounds can be oxidized to form cyanate.<br>Examples: NaOC1, H2O2 [30].','Cyanates','Disposed in sanitary sewer with a large excess of water. (~50:1 ratio) [26]'),(255,'3A','Toxic Chemicals','Hydrogen cyanide','Oxidation','CN-compounds can be oxidized by H2O2 [30]','Cyanates','Disposed in sanitary sewer with a large excess of water. (~50:1 ratio) [26]'),(256,'3A','Toxic Chemicals','Hydrogen cyanide','Oxidation/<br>Hydrolysis','NaOCl, oxidizes HCN to HOCN and forming ClCN. ClCN can then be hydrolyzed with NaOH solution, forming NaOCN (sodium cyanate)','Sodium cyanate','Disposed in sanitary sewer with a large excess of water. (~50:1 ratio) [26]'),(257,'3A','Toxic Chemicals','Chloropicrin: Trichloronitromethane','','Reacts steadily with alcoholic sodium sulfite solution','Methanetri-sulfonic acid',''),(258,'3A','Toxic Chemicals','Chloropicrin: Trichloronitromethane','','Ammonia [15]','Guanidine','Guanidine decomposes to CO2 and Urea above 160 °C [21]—open burning may be a possible solution'),(259,'3B','Precursors','Phosphorus oxychloride','','Useful for reducing primary, secondary and tertiary alcohols to alkenes with pyridine and synthesizing alkylenediphosphoric acids [31]','','Small quantities: see Phosphorus pentachloride <br>(10026-13-8)'),(260,'3B','Precursors','Phosphorus oxychloride','Hydrolysis','Hydrolizes violently in water [32]','Phosphoric acid and HC1 gas','Neutralization and sanitary sewer disposal with a large excess of water'),(261,'3B','Precursors','Phosphorus trichloride','Hydrolysis','Reacts with primary alcohols forming phosphorous acid and alkyl chloride [33]','Phosphorous acid, alkyl chloride, and possibly HC1 gas','Small quantities: In fume hood, cover with excess Na2CO3 or CaCO3 add very slowly to a pail/bucket of cold water. Let stand for 24 hours, test pH, neutralize if necessary, and pour down drain with excess water ~50:1 ratio. (PCl5 + 4H2O –NaOH–> H3PO4 + 5HCl –> Na3PO4 + 5NaCl) [14]'),(262,'3B','Precursors','Phosphorus pentachloride','','Reacts violently with water, carboxylic acids, and alcohols [33]','Phosphoric acid (in water), POC13 (carboxylic acids and alcohols) and HC1 gas','Small quantities: In fume hood, cover with excess Na2CO3 or CaCO3 add very slowly to a pail/bucket of cold water. Let stand for 24 hours, test pH, neutralize if necessary, and pour down drain with excess water ~50:1 ratio. (PCl5 + 4H2O –NaOH–> H3PO4 + 5HCl –> Na3PO4 + 5NaCl) [14]'),(263,'3B','Precursors','Trialkyl phosphites','Oxidation','Trialkyl phosphites react with hydroperoxides [34]','Alcohol from hydroperoxide and a trialkyl phosphate','UV and advanced oxidation treatment (UV-H2O2), then dispose in sanitary sewer with a large excess of water'),(264,'3B','Precursors','Trialkyl phosphites','Oxidation','Hydrogen peroxide','Water and trialkyl phosphates','UV and advanced oxidation treatment (UV-H2O2), then dispose in sanitary sewer with a large excess of water'),(265,'3B','Precursors','Dialkyl phosphites','Amines','Reactions of DMP with amines produce N-alkylammonium O-methylphosphites [35].','N-alkylammonium O-alkylphosphites','Dispose in sanitary sewer with a large excess of water'),(266,'3B','Precursors','Dialkyl phosphites','Pudovik reaction','Pudovik reaction produces α-hydroxy phosphonates [36].','α-hydroxy phosphonates','Dispose in sanitary sewer with a large excess of water'),(267,'3B','Precursors','Sulfur monochloride','Hydrolysis','Hydrolysis: forms a variety of products, including HCl, H2S2O2, H2S2O3, and H2S [37] [38]','HCl, H2S2O2, H2S2O3, and H2S','Neutralize if necessary and dispose in sanitary sewer with a large excess of water'),(268,'3B','Precursors','Sulfur dichloride','Oxidation','Oxidized using SO3 to form SO2 and SOCl2 [39]','SO2 and SOCl2','Disposed in sanitary sewer with a large excess of water'),(269,'3B','Precursors','Thionyl chloride','','Reaction with 2° alcohols (Chlorinates) [40]','SO2 and HCl','Dilute HCl can be neutralized with Na2CO3, CaCO3, or dilute NaOH soln disposed in sanitary sewer with a large excess of water [26].'),(270,'3B','Precursors','Tertiary amines','','Tertiary amines can be oxidized by H2O2 (R3N + H2O2 -> R3N(+)-O(--) + H2O) [41].','R3N(+)-O(--) + H2O','Disposed in sanitary sewer with a large excess of water');
